import React from 'react';
import './state.css';


class state extends React.Component {
    constructor(props) {
        super(props);
        this.state = {name: '开始学习'};
    }

    render() {
        return <div className="App">
            <header className="App-header">
                <p>({this.state.name})</p>
            </header>
        </div>;
    }
}

export default state;
